import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const TAX_RATE = 0.07;

const useStyles = makeStyles({
  table: {
    minWidth: 700,
  },
});

function ccyFormat(num) {
  return `${num.toFixed(2)}`;
}

function priceRow(qty, unit) {
  return qty * unit;
}

function createRow(desc, qty, unit) {
  const price = priceRow(qty, unit);
  return { desc, qty, unit, price };
}

function subtotal(items) {
  return items.map(({ price }) => price).reduce((sum, i) => sum + i, 0);
}

const rows = [
  createRow('Paperclips (Box)', 100, 1.15),
  createRow('Paper (Case)', 10, 45.99),
  createRow('Waste Basket', 2, 17.99),
];

const invoiceSubtotal = subtotal(rows);
const invoiceTaxes = TAX_RATE * invoiceSubtotal;
const invoiceTotal = invoiceTaxes + invoiceSubtotal;

export default function SpanningTable() {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="spanning table">
        <TableHead>
          <TableRow>
            <TableCell></TableCell>
            <TableCell align="right">Ubicacion</TableCell>
            <TableCell align="right">Espesor remanente zona critica [mm]</TableCell>
            <TableCell align="right">Espesor remanente promedio [mm]</TableCell>
            <TableCell align="right">Tasa de desgaste m√°xima [mm/Mton]</TableCell>
            <TableCell align="right">Tasa de desgaste promedio [mm/Mton]</TableCell>
            <TableCell align="right">Espesor de cambio [mm]</TableCell>

          </TableRow>
        </TableHead>
        <TableBody>
            <TableRow key={1}>
                <TableCell>Concavas</TableCell>
                <TableCell align="right">Fila 4</TableCell>
                <TableCell align="right">64.8</TableCell>
                <TableCell align="right">63</TableCell>
                <TableCell align="right">6.1</TableCell>
                <TableCell align="right">5.9</TableCell>
                <TableCell align="right">40</TableCell>
            </TableRow>
        </TableBody>
      </Table>
    </TableContainer>
  );
}
